import React from "./node_modules/react";
import { Grid } from './node_modules/@material-ui/core';

import Product from './Product/Product';

const products = [
    { id: 1, name: "T-Shirt", description: "Signature Visten T-shirt. 100% cotton.", price: "$20", image: "https://www.google.com/url?sa=i&url=https%3A%2F%2Fshopmouthbreather.com%2Fproduct%2Fmouthbreather-white-tee%2F&psig=AOvVaw0g_s87z6h6OK2-tKVs7zjM&ust=1627619091992000&source=images&cd=vfe&ved=0CAkQjhxqFwoTCMDP3uC3h_ICFQAAAAAdAAAAABAE" },
    { id: 2, name: "Hoodie", description: "Signature Visten embroidered sweatshirt. Only the finest tailoring...", price: "$900", image: "https://www.google.com/imgres?imgurl=https%3A%2F%2Fhips.hearstapps.com%2Fvader-prod.s3.amazonaws.com%2F1584557880-screen-shot-2020-03-18-at-2-57-26-pm-1584557872.png%3Fcrop%3D1xw%3A1xh%3Bcenter%2Ctop%26resize%3D480%3A*&imgrefurl=https%3A%2F%2Fwww.esquire.com%2Fstyle%2Fmens-fashion%2Fg3357%2Fbest-hoodies-men%2F&tbnid=zeFEOTAPPXSFoM&vet=12ahUKEwj47o7Mt4fyAhVVh54KHSUtBBoQMygAegUIARDaAg..i&docid=8Xw7ELdQ33SjSM&w=480&h=648&itg=1&q=image%20of%20hoodie&ved=2ahUKEwj47o7Mt4fyAhVVh54KHSUtBBoQMygAegUIARDaAg" },
]



const Products = () => {
    return (
        <main>
            <Grid container justify="center" spacing={4}>
                {products.map((product) => {
                    <Grid item key={product.id} xs={12} sm={6} md={4} lg={3}>  {/* xs = {12} means for mobile devices, grid takes up whole screen. sm, md and lg mean the same thing for larger devices respectively with 6/12 representing half the screen as an example*/}
                        <Product product={product} />
                    </Grid>
                })}
            </Grid>

        </main>
    );
}

export default Products;
